<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8" />
	<link rel="stylesheet" href="/fonts/Roboto.css" />
	<link rel="stylesheet" href="disable.css" />
	<link rel="stylesheet" href="../scrollbar.css" />
	<style>
		body {
			height: 575px;
			width: 400px;

		}
	</style>
	<script src="../scrollbar.js"></script>
	<title>&nbsp;</title>

<body>
	<div id="bfrl_closeButtonContainer">

	</div>
    <div id="bfrl_disableManageExtensionsLink" class="bfrl_disable_page2_footer" style="padding-top:9px; padding-bottom:9px;">
        <span id="bfrl_aManageExtensions">Manage Browser extensions</span>
    </div>
	<script type="text/javascript" src="disable_common.js"></script>
	<script type="text/javascript" src="disable_page2.js"></script>
